// App Component
const App = () => {
  const [currentScreen, setCurrentScreen] = useState(0);

  const nextScreen = () => {
    if (currentScreen < screens.length - 1) {
      setCurrentScreen(currentScreen + 1);
    }
  };

  const prevScreen = () => {
    if (currentScreen > 0) {
      setCurrentScreen(currentScreen - 1);
    }
  };

  return (
    <Container>
      {screens[currentScreen].logo ? (
        <LogoContainer>
          {screens[currentScreen].renderContent()}
          <Title>{screens[currentScreen].heading}</Title>
        </LogoContainer>
      ) : (
        <Content>
          {screens[currentScreen].renderContent()}
          <Heading>{screens[currentScreen].heading}</Heading>
          <SubHeading>{screens[currentScreen].subheading}</SubHeading>
        </Content>
      )}
      <Footer>
        {currentScreen > 0 && (
          <TextButton onPress={prevScreen}>
            <TextButtonLabel>Anterior</TextButtonLabel>
          </TextButton>
        )}
        <Pagination>
          {screens.map((_, index) => (
            <Dot key={index} active={index === currentScreen} />
          ))}
        </Pagination>
        {currentScreen < screens.length - 1 ? (
          <Button onPress={nextScreen}>
            <ButtonLabel>{">"}</ButtonLabel>
          </Button>
        ) : (
          <Button onPress={() => alert("Bem-vindo à aplicação!")}>
            <ButtonLabel>Começar</ButtonLabel>
          </Button>
        )}
      </Footer>
    </Container>
  );
};

export default App;
